  input: '"TEXT","F3XA","C00135558","Cash balances and calculations for Summary and
    Detailed Summary pages have been amended to reflect previously amended reports.
    There is no discrepancy with our amended report and the FEC calculation for Schedule
    F.  There must have been a problem with the export/upload routine with the original
    report. The America Womens Vote! 2002 memo Schedule A failed to appear on the
    original report due to a case-sensitive field that did not recognize the Transfer
    Memo entries.  This has been corrected on the amended report. The disbursement
    for Yard Signs reported on Schedule B supporting Line 21(b) was made with federal
    contributions and not transfer-ins from either the DSCC or the DNC.  During this
    period, alone, the committee raised $139,551.50 in permissible funds for exempt
    activity. Expenditures made for Consulting Media and canvassing were Generic in
    nature and were allocated accordingly. Clarifications to expenditures for communications,
    event expenses, reimbursements and supplies have been made."'
